import React from 'react'

function todo(props) {

    const {id,title,desc} = props.todo;
  return (
    <article>
             <h1> {id} </h1>
             <h1> {title} </h1>
             <p> {desc} </p>
             {/* <Button><i className='fa fa-trash fa-2x'></i></Button> */}
             <button><i className='fa fa-trash fa-2x'></i></button>
    </article>
  )
}

export default todo;
